// src/FreelancerRouting.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import {
  Freelancer,
  BookmarkJob,
  CreateBookmark,
  FindJobById,
  ListBookmarkedJobs,
  ListJobs,
  JobApplication,
  SkillExperience,
  SkillComponent
} from './FreelancerModule';

const FreelancerRouting = () => (
  <Router>
    <Switch>
      <Route path="/freelancer" exact component={Freelancer} />
      <Route path="/freelancer/bmark/job/listJobs" component={ListJobs} />
      <Route path="/freelancer/bmark/job/find/:id" component={FindJobById} />
      <Route path="/freelancer/bmark/job/list" component={ListBookmarkedJobs} />
      <Route path="/freelancer/bmark/job/add" component={CreateBookmark} />
      <Route path="/freelancer/bmark/job/apply/:id" component={JobApplication} />
      <Route path="/freelancer/skills" component={SkillExperience} />
      <Route path="/freelancer/skill" component={SkillComponent} />
    </Switch>
  </Router>
);

export default FreelancerRouting;
